Обязанности:
.
- Поддержание отношений с поставщиками;
.
- Учёт поступления и реализации товаров;
.
- контроль за хранением и оформление отчётности;
.
- составлять и подписывать сопроводительные документы, акты, накладные;
.
- проведение инвентаризаций;
.
- поиск новых поставщиков европейской обуви с учётом специфики магазина;
.
- принимать товар и проверять его на брак;
.
- рассчитывать скидки и акции на продукцию;
.
- составлять претензии на некачественный товар;
.
- работать с возвратами от покупателей;
.
- в межсезонье активно помогать управляющему в работе магазина (очень важно);
.
- иметь желание работать и развивать уровень обслуживания магазина.
.
Требования:
.
средне-специальное или высшее образование;
опыт работы в торговле не менее 2-х лет;
знание правил торговли и необходимой документации;
знания и умения работы на компьютере и в программах 1С, Excel
способность проводить анализ спроса и предложений на рынке обуви;
.
Условия:
5-ти дневный график работы в центре города;
режим работы с 10.00 до 19.00;
ежегодный оплачиваемый отпуск;
получать корпоративную скидку на товар магазина;
остальные условия обсуждаются на собеседовании.
